def sum_of_primes(numbers):
    primes = []
    for num in numbers:
        if num >= 1:
            is_prime = True
            for i in range(2, int(num / 2) + 1):
                if num % i == 0:
                    is_prime = False
                    break
            if is_prime:
                primes.append(num)
    sum_of_primes = sum(primes)
    numbers.append(sum_of_primes)
    return numbers

